    var lineTextInput = document.querySelector("#lineText");
    var lineText = lineTextInput.value;

    var nextLine = document.createElement("p");
    nextLine.textContent = lineText;
}

Now we have a brand new paragraph!
Inserting the New  Element into the 
We have created a new paragraph, but it still won't appear on our webpage until we insert it somewhere. We want to place it in the lyrics box, our lyricsContainer div. The first thing we need to do is find that  element and store it in a variable:
