    var nextLine = document.createElement("p");
    nextLine.textContent = lineText;

    var lyricsContainer = document.querySelector("#lyricsContainer");
}

Notice the selector we are using here: "#lyricsContainer". Now that we have our  element stored in the lyricsContainer variable, we can insert the paragraph into it! To do that, we use .appendChild:
function addLine() {
    var lineTextInput = document.querySelector("#lineText");
    var lineText = lineTextInput.value;

    var nextLine = document.createElement("p");
    nextLine.textContent = lineText;

    var lyricsContainer = document.querySelector("#lyricsContainer");
    lyricsContainer.appendChild(nextLine);
}

Now, when we click our button, it should create a new paragraph and add it to the lyrics container!
Clearing the Input
The last thing we need to do is clear out the value of our  after a line has been added. To accomplish this, we simply set .value of the  to the empty string (""):
function addLine() {
    var lineTextInput = document.querySelector("#lineText");
    var lineText = lineTextInput.value;

    var nextLine = document.createElement("p");
    nextLine.textContent = lineText;

    var lyricsContainer = document.querySelector("#lyricsContainer");
    lyricsContainer.appendChild(nextLine);

    lineTextInput.value = "";
}

Now our Lyrics Builder is fully functional!
